import React from 'react';
import TopNavbar from './components/TopNavbar';
import BottomNavbar from './components/BottomNavbar';
import Footer from './components/Footer';
import Introduction from './components/Introduction';
import SignUpForm from './components/SignUpForm';
import Grid from 'semantic-ui-react';

const Landing = () => {
	return (
		<Grid container direction='column' className='container' justify='space-between' alignItems='center'>
			<Grid item container>
				<Grid item container>
					<TopNavbar />
				</Grid>
				<Grid item container>
					<BottomNavbar />
				</Grid>
			</Grid>
			<Grid item lg={7} container direction='row-reverse' justify='center' alignItems='center' spacing={7}>
				<Grid item className='rtl'>
					<Introduction />
				</Grid>
				<Grid item>
					<SignUpForm />
				</Grid>
			</Grid>
			<Grid item lg={1}>
				<Footer />
			</Grid>
		</Grid>
	);
};

export default Landing;
